import React, { Component } from 'react'
import { Link } from 'react-router-dom';
// import Root from './root'
class Content extends Component {
       state={
             names:[]
        }
        async get_api(){
        const url='https://api.nytimes.com/svc/books/v3/lists/names.json?api-key=';
        const response=await fetch(url);
        const data= await response.json();
        const list_names=data.results.map((e=>e.display_name));
        this.setState({
            names:list_names
        })
        }
        handleSubmit=event=>{
            this.get_api();
        }
        // componentDidMount(){
        //     console.log(this.props.name);
        //     this.props.name("satheesh");
        // }
    render() { 

        return ( 
            <div>
                <h1>Hiiii</h1>
                <button onClick={this.handleSubmit}>ListBooks</button>
               { this.state.names.map((value) => (

                    <div>
                        <Link to="/home/fetch"><h2>{value}</h2></Link>                     
                    </div>
                 )  
               )}

            </div>
         );
    }
}

export default Content;
